import "./App.css";
import Navbar from "./components/NavBar/NavBar";
import { Fragment } from "react";
import { Route, Routes } from "react-router-dom";

function App() {
  return (
    <Fragment>
      <Navbar />
      <main>
        <Routes>
          <Route path="login" />
        </Routes>
      </main>
    </Fragment>
  );
}

export default App;
